import React from "react";
import {
    Avatar,
    Button,
    CssBaseline,
    TextField,
    Link,
    Grid,
    Box,
    Typography,
    Container,
    createTheme,
    ThemeProvider,
} from "@mui/material";
import LockOutlinedIcon from "@mui/icons-material/LockOutlined";
import { styled } from "@mui/system";

// Define a theme. You can customize palette, typography, etc.
const theme = createTheme({
    palette: {
        // Example: Making the secondary color more distinct if needed
        // secondary: {
        //   main: '#e91e63', // A different pink/red
        // },
    },
    // You can also adjust spacing globally if desired
    // spacing: 8, // Default is 8px for 1 spacing unit
});

// Renamed to ContentWrapper for clarity, using Box for sx prop and semantic meaning
const ContentWrapper = styled(Box)(({ theme }) => ({
    marginTop: theme.spacing(8), // Space from the top of the page
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    padding: theme.spacing(3), // Added padding around the entire content block
    // For a more "card" like feel, you could add:
    // backgroundColor: theme.palette.background.paper,
    // borderRadius: theme.shape.borderRadius,
    // boxShadow: theme.shadows[3],
}));

const StyledAvatar = styled(Avatar)(({ theme }) => ({
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main, // Uses the theme's secondary color
}));

const StyledForm = styled("form")(({ theme }) => ({
    width: "100%", // Fix IE 11 issue.
    marginTop: theme.spacing(1), // Adjusted margin, as ContentWrapper has padding and Title has margin
}));

const SubmitButton = styled(Button)(({ theme }) => ({
    margin: theme.spacing(3, 0, 2), // Standard MUI spacing for submit buttons (3 top, 0 L/R, 2 bottom)
}));

export default function SignUp() {
    const handleSubmit = (event: React.FormEvent<HTMLFormElement>) => {
        event.preventDefault();
        const data = new FormData(event.currentTarget);
        console.log({
            firstName: data.get("firstName"),
            lastName: data.get("lastName"),
            email: data.get("email"),
            // Note: For security, never log passwords in a real app
        });
        // Add your form submission logic here
    };

    return (
        <ThemeProvider theme={theme}>
            <Container component="main" maxWidth="xs">
                <CssBaseline />
                <ContentWrapper>
                    <StyledAvatar>
                        <LockOutlinedIcon />
                    </StyledAvatar>
                    <Typography component="h1" variant="h5" sx={{ mb: 3 }}> {/* Added margin-bottom for spacing */}
                        Sign up
                    </Typography>
                    <StyledForm noValidate onSubmit={handleSubmit}>
                        <Grid container spacing={2}>
                            <Grid item xs={12} sm={6}>
                                <TextField
                                    autoComplete="given-name" // More standard autocomplete value
                                    name="firstName"
                                    required
                                    fullWidth
                                    id="firstName"
                                    label="First Name"
                                    autoFocus
                                />
                            </Grid>
                            <Grid item xs={12} sm={6}>
                                <TextField
                                    required
                                    fullWidth
                                    id="lastName"
                                    label="Last Name"
                                    name="lastName"
                                    autoComplete="family-name" // More standard autocomplete value
                                />
                            </Grid>
                            <Grid item xs={12}>
                                <TextField
                                    required
                                    fullWidth
                                    id="email"
                                    label="Email Address"
                                    name="email"
                                    autoComplete="email"
                                />
                            </Grid>
                            <Grid item xs={12}>
                                <TextField
                                    required
                                    fullWidth
                                    name="password"
                                    label="Password"
                                    type="password"
                                    id="password"
                                    autoComplete="new-password"
                                />
                            </Grid>
                            {/* Removed FormControlLabel for Checkbox as it wasn't in the original problem description
                  If you need a "Remember me" or "Terms" checkbox, it would go here.
              */}
                        </Grid>
                        <SubmitButton
                            type="submit"
                            fullWidth
                            variant="contained"
                        // color="primary" // variant="contained" defaults to primary color
                        >
                            Sign Up
                        </SubmitButton>
                        <Grid container justifyContent="center"> {/* Centered the link for better balance */}
                            <Grid item>
                                <Link href="/" variant="body2">
                                    Already have an account? Sign in
                                </Link>
                            </Grid>
                        </Grid>
                    </StyledForm>
                </ContentWrapper>
            </Container>
        </ThemeProvider>
    );
}
